import React, { FunctionComponent } from "react";
import Skin from "../../models/skin";

import "./style.css"

type Props = {
    skin: Skin
};

const SkinDetail: FunctionComponent<Props> = ({ skin }) => {

    return (
        <div className="testrouxdetail">
            <p>{skin.id}</p>
        </div>
    )
}

export default SkinDetail;
